import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import HouseForm from './components/HouseForm';

import './App.css';

function App() {
  return (
    <Router>
        <Routes>
          <Route path="/addHouse">
          <Route path="/" element={<HouseForm />} />
          </Route>
        </Routes>
    </Router>
  );
}

export default App;
